import React from "react";
import { StyleSheet, Text, View } from "react-native";

function MyApp() {
  return (
    <View style={styles}>
      <Text>Myapp text</Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});

export default MyApp;
